ついに出ました!!ありそでなかったステンシルフォントのスタンプ!!
<BR><BR>ミリタリー関係やコンテナなどなどでお目にかかる、あのステンシル文字をだれでも手軽に楽しめるスタンプになって、アルファベット・数字・記号　そして、あらゆる素材にスタンプ出来る専用インク付きのお届けしてすぐに楽しめるお得なセット!!
<BR><BR>・文字サイズは、0.6インチ(高さ約1.5cm ※記号除く)。
<BR>・文字種は、『A～Z  0～9　6種の記号』　計42ピース/1セット。
<BR><BR>スタンプなら、養生したりする手間がいらないので、本当に簡単にポンポン押してオリジナルカスタムを楽しむことができます。
<BR><BR>専用インクを使うことで、プラスチック・金属・布・皮革・ガラス・陶器・木などあらゆる素材にスタンプすることが可能になります!!
<BR><font size=-1>（※各々の素材により乾燥時間や耐久性は異なります。）</font>
<BR><BR>アメリカンライフ・ガレージライフENJOY GOODS。
<br><br>※画像3枚目下はサンプル制作例の為、当該商品には付属致しません。
<br>※ご使用のモニター環境などで写真の色目と実物は、若干違う場合がございますのでご了承ください。
<br><br><B>【SPEC】</B>
<br>・スタンプ：新品　木・ラバー製　サイズ：約縦2ｘ横1.6ｘＨ5cm(スタンプ1個※記号除く）　made in china
<br><br>・インク：新品　油性インキ　補充用インキ（5ml)ｘ1本　交換用スタンプパッドx1枚　スタンプ台x1個　made in JAPAN
<br><br>
